import React from 'react';



class Registerform extends React.Component {



    constructor(props){
        super(props);

        this.state = {
            email: '',
        };

        

        this.handleSubmit = this.handleSubmit.bind(this);

    }
    componentDidMount() {
        const script = document.getElementsByClassName("g-recaptcha")

        script.src = "https://www.google.com/recaptcha/api.js";
        script.async = true;

        document.body.appendChild(script);
    }

    handleSubmit(event) {
        event.preventDefault();

        const data = {email:this.state.email};

    }
    handleChange(event){
        this.setState({
            [event.target.email]: event.target.value
        })
    }



    render(){
        return(
            <div>
                <form method="post" action="/register" onSubmit={this.handleSubmit}>
                    Email : <br />
                    <input type="text" name="email" onChange={this.handleChange}/>
                    <div className="g-recaptcha" data-sitekey="6LeM5rwZAAAAAN_oBVB8O5T2TpEArvf-nR-1PSpSy"> </div>
                    <br />
                    <input type="submit" value="Register" onChange={this.handleChange}/>
                </form>
            </div>
        )
    }
}

  

export default Registerform;
